import React from 'react';

import Auxiliary from './../../hoc/Auxiliary';

function Layout(props) {
    return (
        <Auxiliary>
            <div>Toolbar</div>
            <main>
                {props.children}
            </main>
        </Auxiliary>
    )
}

export default Layout;
